## Usage

Before you use the following code sample, customize the following values for your configuration:

- `YOUR_COLLECTION_NAME`: Use our [Collections](https://qdrant.tech/documentation/concepts/collections/) guide to create or list collections.
- `YOUR_HOST_URL`: Use the GRPC URL for your system. If you used the [Quick Start](https://qdrant.tech/documentation/quick-start/) guide, it may be http\://localhost:6334. If youve deployed in the [Qdrant Cloud](https://qdrant.tech/documentation/cloud/), you may have a longer URL such as `https://example.location.cloud.qdrant.io:6334`.
- `YOUR_API_KEY`: Substitute the API key associated with your configuration.

```java
import dev.langchain4j.store.embedding.EmbeddingStore;
import dev.langchain4j.store.embedding.qdrant.QdrantEmbeddingStore;

EmbeddingStore<TextSegment> embeddingStore =
    QdrantEmbeddingStore.builder()
        // Ensure the collection is configured with the appropriate dimensions
        // of the embedding model.
        // Reference https://qdrant.tech/documentation/concepts/collections/
        .collectionName("YOUR_COLLECTION_NAME")
        .host("YOUR_HOST_URL")
        // GRPC port of the Qdrant server
        .port(6334)
        .apiKey("YOUR_API_KEY")
        .build();
```

`QdrantEmbeddingStore` supports all the semantic features of Langchain4J.
